interface ProjectCardProps {
    title: string;
    description: string;
    technologies: string[]
}

const ProjectCard = ({title, description, technologies}: ProjectCardProps) => {
    return (
      <div className="bg-white rounded-lg shadow-lg p-6 dark:bg-gray-800"> {/* Add dark:bg-gray-800 */}
      <h3 className="text-xl font-bold mb-2 dark:text-white">{title}</h3> {/* Add dark:text-white */}
      <p className="text-gray-600 mb-4 dark:text-gray-300">{description}</p> {/* Add dark:text-gray-300 */}
          <div className="flex flex-wrap">
            {technologies.map((tech) => (
              <span key={tech} className="bg-gray-200 text-gray-800 text-sm font-medium mr-2 px-2.5 py-0.5 rounded mb-2">
                {tech}
              </span>
            ))}
          </div>
        </div>
      );
}

export default ProjectCard;
